    jQuery(this).removeClass("noselecedimg");
    jQuery(this).addClass("selectedimg");
    jQuery("#img_"+id).val(id);
  }else{
    jQuery(this).removeClass("selectedimg");
    jQuery(this).addClass("noselecedimg");
    jQuery("#img_"+id).val(0);
  }

});



